/* Ensure the parent container uses flexbox to center its children */
.parent-container {
    display: flex;
    justify-content: center;
    /* Center horizontally */
    align-items: center;
    /* Center vertically */
    height: 100%;
    /* Ensure it takes the full height of its parent */
    width: 100%;
    /* Ensure it takes the full width of its parent */
    position: absolute;
    /* Ensure it fills the entire space of its parent */
    top: 0;
    left: 0;
}

/* Style for SVG container */
div.ui-svg {
    display: inline-block;
    border: 1px solid #ffffff;
    /* White solid border */
    border-radius: 8px;
    /* Rounded corners with 8px radius */
    color: black;
    /* Text color */
}

/* Style for SVG elements */
div.ui-svg svg {
    color: var(--nr-dashboard-widgetColor);
    fill: currentColor !important;
    display: block;
    /* Prevents inline SVGs from adding whitespace */
    margin: auto;
        /* Centers the SVG within its container */
}

div.ui-svg path {
    fill: inherit;
}

