// Function to update vertical position
function updateVerticalPosition(targetPosition) {
    // Read the current vertical position from the global context
    let currentPosition = global.get('vertical_position') || 0;

    // Determine the direction to move
    let direction = currentPosition > targetPosition ? -1 : 1;

    // Function to update the position
    function updatePosition() {
        currentPosition += direction;

        // Update the global variable with the new position
        global.set('vertical_position', currentPosition);

        // Create and send a message with the new position
        let msg = { payload: currentPosition, topic: 'vertical_position_update' };
        node.send(msg);

        // Check if the target position has been reached
        if ((direction === -1 && currentPosition <= targetPosition) ||
            (direction === 1 && currentPosition >= targetPosition)) {
            clearInterval(context.get('intervalId'));
            context.set('running', false);
        }
    }

    // Set interval to update position every 6ms if not already running
    if (!running) {
        context.set('running', true);
        let intervalId = setInterval(updatePosition, 6);
        context.set('intervalId', intervalId);
    }
}

