let modbusResponse = context.get('modbusResponse') || false;

if (msg.topic === 'modbus_response') {
    // Modbus response received, allow next timestamp
    context.set('modbusResponse', true);
    return null;
} else if (modbusResponse) {
    // Timestamp allowed to pass through
    context.set('modbusResponse', false);
    return msg;
} else {
    // Timestamp not allowed yet, drop message
    return null;
